import { useGSAP } from "@gsap/react";
import gsap from "gsap";
import { Col } from "react-bootstrap";
import {Row} from "react-bootstrap"
function Project()
{
   useGSAP(()=>{
    gsap.from('#team',{
        opacity:0,
        scale:1,
        y:50,
        duration:1.5
        
    })
   })
   
    return(
      <>
       <Row id="team">
        <Col md={12} lg={12}>
        <div >
         <h1>WE DESIGN<br></br>
         TAILOR-MADE<br></br>
          IMMERSIVE<br></br>
          EXPERIENCES<br></br>
          BY ALWAYS<br></br>
           FREEDOM</h1>     
        </div>
        </Col>
       </Row>
       <Row></Row>
       </>
      
      
    )
}
export default Project;
